import '../Styles/Dashboard.css';
import { useState } from 'react';
import { Link } from 'react-router-dom';
import axios from '../axios/axios';
import Navbar from './Navbar';
import Topnav from './Topnav';
import calendar from '../Assets/calendar.svg';
import calendar_white from '../Assets/calendar_white.svg';

const Dashboard = (props) => {
  const [name, setName] = useState(props.name);

  return (
    <div className='dashboard-wrapper'>
      <div className='dashboard-header'>
        <h1>Hello, {name}</h1>
        <button>
          <img
            src={calendar}
            className='nav-img'
            onMouseOver={(e) => (e.currentTarget.src = calendar_white)}
            onMouseOut={(e) => (e.currentTarget.src = calendar)}
            alt='calendar'
          />
          New appointment
        </button>
      </div>
      <div className='active-appointments'>
        <p className='half-width-border'>Your appointments</p>
        <div className='appointments-wrapper'>
          <div className='appointment-card'></div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
